import React from "react";
import "./Banner.css";

function Banner() {
  return (
    <div className="banner">
      <img
        className="banner-logo"
        src="https://www.spacex.com/static/images/share.jpg"
        alt="SpaceX Logo"
      />
      <div className="banner-images">
        <img
          className="banner-rocket"
          src="https://www.spacex.com/static/images/homepage/hero-section/landing.png"
          alt="SpaceX Rocket"
        />
        <img
          className="banner-capsule"
          src="https://www.spacex.com/static/images/homepage/hero-section/dragon.png"
          alt="SpaceX Capsule"
        />
      </div>
    </div>
  );
}

export default Banner;
